export const DropdownBasic: React.FunctionComponent<{toggles, onSelect, selected}> = ({toggles, onSelect, selected}) => {
  const [isOpen, setIsOpen] = React.useState(false);

  const onToggle = (isOpen: boolean) => {
    setIsOpen(isOpen);
  };

  const onFocus = () => {
    const element = document.getElementById('toggle-basic');
    element?.focus();
  };

  const onItemSelect = (e) => {
    setIsOpen(false);
    onFocus();
    onSelect(e.target.name)
    console.log(e.target.name, selected)
  };
  
  return (
    <Dropdown
      onSelect={onItemSelect}
      toggle={<DropdownToggle id="toggle-basic" onToggle={onToggle}>{selected == '' ? "Select a failing suite" : selected}</DropdownToggle>}
      isOpen={isOpen}
      dropdownItems={
        toggles.sort((a,b) => b.count - a.count).map( (toggle, idx) => <DropdownItem key={idx} name={toggle.suite_name}> {toggle.suite_name} (<strong style={{color: 'red'}}>{toggle.count}</strong>) </DropdownItem> )
      }
      />
  );
};

interface Flakey {
  name: string;
  status: string;
  error_message: {
    job_id: string;
    job_url: string;
    error_message: string;
  }[];
  count: number;
  suite_name: string;
}

export const ComposableTableNestedExpandable: React.FunctionComponent<{teams}> = ({teams}) => {
  // In real usage, this data would come from some external source like an API via props.

  const columnNames = {
    name: 'Test Case',
    status: 'Status',
    error_message: 'Failing Jobs',
    count: 'Count',
    suite_name: 'Suite Name',
    job_id: "Job ID",
    job_url: "Job Url"
  };

  // In this example, expanded rows are tracked by the team names from each row. This could be any unique identifier.
  // This is to prevent state from being based on row order index in case we later add sorting.
  // Note that this behavior is very similar to selection state.
  const [expandedTeamNames, setExpandedTeamNames] = React.useState<string[]>([]);
  const setTeamExpanded = (flakey: Flakey, isExpanding = true) =>
    setExpandedTeamNames(prevExpanded => {
      const otherExpandedTeamNames = prevExpanded.filter(t => t !== flakey.name);
      return isExpanding ? [...otherExpandedTeamNames, flakey.name] : otherExpandedTeamNames;
    });
  const isTeamExpanded = (flakey: Flakey) => expandedTeamNames.includes(flakey.name);

  const expandPre = (e) => {
    if(e.currentTarget.classList.contains('expandedPre')){
      e.currentTarget.classList.remove("expandedPre")
      e.currentTarget.classList.add('collapsedPre')

    } else {
      e.currentTarget.classList.remove('collapsedPre')
      e.currentTarget.classList.add('expandedPre')
    }
    console.log(e.currentTarget.classList)
  }
  return (
    <InnerScrollContainer>
      <TableComposable aria-label="Nested column headers with expandable rows table" gridBreakPoint="">
        <Thead hasNestedHeader>
          <Tr>
            <Th rowSpan={2} />
            <Th width={50} >
              {columnNames.name}
            </Th>
            <Th >
              {columnNames.status}
            </Th>
            <Th >
              {columnNames.count}
            </Th>
            <Th >
              {columnNames.suite_name}
            </Th>
          </Tr>
        </Thead>
        {teams.map((team, rowIndex) => (
          <Tbody key={rowIndex} isExpanded={isTeamExpanded(team)}>
            <Tr>
              <Td expand={{ rowIndex, isExpanded: isTeamExpanded(team), onToggle: () => setTeamExpanded(team, !isTeamExpanded(team)), expandId: 'composable-nested-expandable-example' }}/>
              <Td dataLabel={columnNames.name}>{team.name}</Td>
              <Td dataLabel={columnNames.status}>{team.status}</Td>
              <Td dataLabel={columnNames.count}>{team.count}</Td>
              <Td dataLabel={columnNames.suite_name}>{team.suite_name}</Td>
            </Tr>
            <Tr isExpanded={isTeamExpanded(team)} className='pf-px-xl'>
              <Td></Td>
              <Td colSpan={5}>
                <ExpandableRowContent>
                  <TableComposable aria-label="Error messages" variant="compact">
                    <Thead>
                      <Tr>
                        <Th width={20}>{columnNames.job_id}</Th>
                        <Th width={80}>
                          Error messages 
                        </Th>
                      </Tr>
                    </Thead>
                    <Tbody>
                      {team.error_message && team.error_message.map((repo, idx) => (
                        <Tr key={idx}>
                          <Td dataLabel={columnNames.job_id}>
                            <a href={repo.job_url}>{repo.job_id}</a>
                          </Td>
                          <Td dataLabel="Error messages" onClick={expandPre} className='collapsedPre'>
                            <p  style={{textAlign: 'center'}}><i>Click to collapse/expand</i></p>
                            <pre>
                              {repo.error_message}
                            </pre>
                          </Td>
                        </Tr>
                      ))}
                    </Tbody>
                  </TableComposable>
                </ExpandableRowContent>
              </Td>
            </Tr>
          </Tbody>
        ))}
      </TableComposable>  
    </InnerScrollContainer>
  );
};

